    false,nt"url": null,nt"notes": "LOCATION: Lat. 390 35u2019 56.0u201d N,
    long. 930 13u2019 25u201d W, at Swan Lake NWR, 23.5 miles southeast of Chillecothe,
    MO, in Charlton County. Gage is located near abandoned railroad bridge crossing
    on western border of Swan Lake NWR. DRAINAGE AREA: 113 square miles SURFACE WATER
    RECORDS PERIOD OF RECORD: November 30, 2011 to present. GAGE SITE: Design Analysis
    522+ in communication with Esterline pressure transducer in a square metal gage
    house. GOES antenna in communication with DA 522+ DCP transmits every hour in a
    10 second window at a baud rate of 300.Instruments are powered by a solar panel
    run to a battery through a Sunsaver power regulator. Solar panel, GPS and GOES antennas
    are attached to a mast connected to the gage house. Stage is collected at 15u2010minute
    intervals. Weekly gage height data available online, NWS Id is SUMM7. Datum of gage
    is in North American Vertical Datum of 1988. NATIONAL WILDLIFE REFUGE: Swan Lake
    NWRREMARKS: Records coded fair for 2012 calendar year. EXTREMES FOR PERIOD OF RECORD:
    Maximum gage height, 656.23 ft, March 31, 2012; minimum gage height, 645.27 ft,
